import React from 'react'
import { Layout, Menu } from 'antd';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
} from '@ant-design/icons';

import Sidebar from '../sidebar/sidebar'
import MainView from '../MainView'

const { Header, Sider, Content } = Layout;

const backgroundImage = 'images/woman.jpg';
const SidebarHeader = '/LogoW.png'
const menuItems = [
  { name: 'Home', to: '/', icon: 'icons/home.svg' },
  { name: 'Porfile', to: '/porfile', icon: 'icons/porfile.svg' },
  { name: 'Ubication', to: '/ubication', icon: 'icons/ubication.svg' },
  { name: 'Reports', to: '/reports', icon: 'icons/reports.svg' },
  { name: 'Chat', to: '/chat', icon: 'icons/chat.svg' }
];

const fonts = {
  header: 'ZCOOL KuaiLe',
  menu: 'Poppins'
}


class Profile extends React.Component {
  state = {
    collapsed: false,
  };

  toggle = () => {
    this.setState({
      collapsed: !this.state.collapsed,
    });
  };

  render() {
    return (
      <Layout
        backgroundImage={backgroundImage}
        SidebarHeader={SidebarHeader}
        menuItems={menuItems}
        fonts={fonts}
      />
    );
  }
}

export default Profile
